import React from "react";
import ReactDOM from "react-dom";
import GameCircle from "./GameCircle";

 const GameBoard = () => {
    return(
         <div>
            <GameCircle id={1}/>
            <GameCircle id={2}/>
            <GameCircle id={3}/>
            <GameCircle id={4}/>
            <GameCircle id={5}/>

         </div>
    );
 }

 export default GameBoard;
